•	Грузовой лифт: 1
•	В доме: Консьерж / Мусоропровод
•	Парковка: Подземная / За шлагбаумом во дворе
•	Двор: Закрытая территория / Детская площадка / Спортивная площадка
•	Состояние фасада: - презентабельный вид.

ЧЕТЫРЕХ КОМНАТНАЯ КВАРТИРА: - распашонка;

-   Общая жилая площадь  - 86,4м2;
-   Зал  - 36,3м2   (на полу ламинат);
-   Три Спальные комнаты  - 16,8;  17,0;  16,3 м2   (на полу ламинат);
-   Кухня  13,4м2 (на полу ламинат);
-   Гардеробная - 6м2;
